import React, { useEffect, useState } from 'react';
import { getalbumData } from '../services/albumService';
import { getwinkelData } from '../services/winkelService';
import {getArtistData} from '../services/artiestService';

const Dashboard = () => {
  const [albums, setAlbums] = useState([]);
  const [artists, setArtists] = useState([]);
  const [winkels, setWinkels] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const albumdata = await getalbumData();
        setAlbums(albumdata);
        const artistdata = await getArtistData();
        setArtists(artistdata);
        const winkeldata = await getwinkelData();
        setWinkels(winkeldata);
      } catch (error) {
        console.error('Error fetching album data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <>

      <div>
        <h1>Dashboard</h1>
      </div>

      <div>
      <h1>Albums</h1>

        <ul>
          {albums.map((album) => (
            <li key={album.id}>{album.albumName}</li>
          ))}
        </ul>
      </div>


      <div>
      <h1>Artists</h1>

        <ul>
          {artists.map((artist) => (
            <li key={artist.id}>{artist.name}</li>
          ))}
        </ul>
      </div>

      <div>
      <h1>Shops</h1>

        <ul>
          {winkels.map((winkel) => (
            <li key={winkel.id}>{winkel.name}</li>
          ))}
        </ul>
      </div>
    </>
  );
};

export default Dashboard;
